import React from 'react';

import {AppBar} from '@material-ui/core';

const styles = {
    root: {
        flexGrow: 1,
    }
}

const LoginContainer = (props) => {
    return (
        <AppBar styles={styles.root}>
            <h1>Test</h1>
        </AppBar>
    )
};

export default LoginContainer;
